import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';
import Login from './Login'
import Nav from './Nav'

function App() {
  return (
    <div className="App">
      <Router>
        <div>
          <Nav />
        <Switch>
          <Route path="/login">
            <Login/>
          </Route>  
        </Switch>
      </div>
    </Router>
    </div>
  );
}

export default App;
